import React from 'react';
import {withFormik} from 'formik';
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCloud } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';
import './login.css';

const FormHolder = styled.form`
display:flex;
flex-direction: column;
align-items: center;
width:40%;
padding:2rem;
margin: 5rem 1rem;
border-radius: 10px;
box-shadow: 5px 5px 5px 5px lightgrey;
background-color: #00B2EE;
color: white;
text-shadow: -1px -1px 0 #003F87, 1px 1px 0 #003F87, 0 -1px 0 #003F87, 0 1px 0 #003F87, 1px -1px 0 #003F87, -1px 1px 0 #003F87, 1px 0 0 #003F87, -1px 0 0 #003F87; 
`

const DivContainer = styled.div`
display: flex;
justify-content: center;
`

const SignUpButton = styled.button`
border: #003F87 2px solid;
width: 61%;
padding: .5rem 1.5rem;
margin-top:2rem;
margin-bottom: 2rem;
color: #003F87;
border-radius: 10px;
font-size: 1.3rem;
margin-left: .5rem;
`

function Login(){
    return(
        <DivContainer>
            <FormHolder>
                <FontAwesomeIcon icon={faCloud} className='cloud-icon2' />
                <h1>Login</h1>
                <label class='label' htmlFor='username'>
                    <div>Username:</div>
                    <input type='text' name='username' id='username'/>
                </label>
                <label class='label' htmlFor='password'>
                    <div>Password:</div>
                    <input type='password' name='password' id='password'/>
                </label>
                <label class='label' htmlFor='user'>
                    <div>login as:</div>
                    <input type='checkbox' name='password' id='password'/>
                </label>
                <SignUpButton type='submit'>Sign In</SignUpButton>
                <div className='text'>Not a member yet? <Link className='sign-up-link' to='/sign-up'>Sign-Up</Link></div>
            </FormHolder>
        </DivContainer>
    )
}


export default Login;
